script: |
  super -f text -I q1920.spq | sort > q1920.out

inputs:
  - name: q1920.spq
    data: |
      SELECT col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col2 * + - col0 NOT BETWEEN NULL AND - - ( + - col0 ) * + col2 + - col1;
  - name: tab2

outputs:
  - name: q1920.out
    data: |
      51
      67
      77
